import React from 'react';
import ErrorSymbol from '../../errorSymbol/components/ErrorSymbolComponent';
import removeErrorNotNull from '../../untils/removeErrorNotNull';

class InputWitchCkeckingNotNull extends React.Component {
  constructor(props) {
    super(props);
    this.state = { valueInitial: '' };
  }

  render() {
    const {
      classInput, classSymbol,
    } = this.props;
    const { valueInitial } = this.state;
    return (
      <>
        <input
          className={classInput}
          type="text"
          name="firstName"
          value={valueInitial}
          onChange={((event) => {
            this.setState({ valueInitial: event.target.value });
            removeErrorNotNull(classInput, classSymbol);
          })}
        />
        <ErrorSymbol Class={`${classSymbol} -disabled`} />
      </>
    );
  }
}

export default InputWitchCkeckingNotNull;
